INSERT INTO `dktn` (`id`, `tennd`, `noidung`, `hinh`, `ghichu`) VALUES
(2, 'Giai đoạn 1954 - 1975', 'Ngày 20-7-1954, Hiệp định Genève được ký kết. Pháp rời khỏi Đông Dương và Việt Nam tạm thời bị chia cắt thành hai miền Bắc và Nam. Ngày 11-3-1955, Ngô Đình Diệm ra Dụ số 21 giải thể Hoàng triều Cương thổ để sáp nhập Đà Lạt vào Cao nguyên Trung Phần do đại biểu tại Cao nguyên Trung Phần phụ trách. Từ đây, mọi người dân được tự do đến Đà Lạt cư trú. Vì Đà Lạt vẫn được xem là địa bàn chiến lược quan trọng ở  Nam Tây Nguyên nên chính quyền Sài Gòn lúc bấy giờ cấp tốc thiết lập nơi đây một hệ thống hành chính khá hoàn chỉnh. Trong hệ thống này, trên hết là Thị trưởng với bộ máy giúp việc gồm các Ty Nội an và Quân vụ, Hành chính, Tài chính, Kinh tế, Vệ sinh, Trung tâm Huấn luyện và Tu nghiệp, Văn phòng,… Bên cạnh đó còn có Hội đồng tư vấn đô thị bao gồm những người có chức tước và có quyền lực về kinh tế (các nhà thầu khoán, các nhà buôn). Về tổ chức hành chính, Đà Lạt được chia thành 10 khu phố, xã Liên Hiệp và ấp Thái Phiên. Mỗi khu phố gồm có nhiều ấp, mỗi ấp đều có ấp trưởng trực tiếp quản lý mạng lưới liên gia có từ 10 đến 30 hộ gia đình đặt dưới sự giám sát của liên gia trưởng về mọi mặt hành chính cũng như an ninh trật tự.\r\n<br>\r\nBởi vậy, chỉ trong vòng hơn hai năm từ 1954 đến 1956, dân số Đà Lạt đã tăng vọt từ trên 25.000 người lên 58.958 người, trong đó một bộ phận dân cư rất quan trọng bổ sung vào dân số Đà Lạt trong giai đoạn này là dòng người di cư từ miền Bắc vào theo chính sách di dân của chính quyền miền Nam, cùng với làn sóng người miền Trung đến lập nghiệp.\r\n<br>\r\nNgày 19-5-1958, Ngô Đình Diệm ban hành sắc lệnh 261/NV thành lập tỉnh Tuyên Đức và cắt một phần lãnh thổ Đà Lạt nhập vào tỉnh Tuyên Đức nên dân số Đà Lạt đã giảm xuống còn 43.000 người.\r\n<br>\r\nTrong những năm 1960, dân số Đà Lạt gia tăng điều hòa: từ 73.000 người năm 1965 lên 89.656 người năm 1970. Từ năm 1970 trở đi, bởi tình hình chiến sự ngày càng ác liệt nên cư dân Đà Lạt cũng có sự biến động đáng kể, đến năm 1975 dân số Đà Lạt chỉ còn 85.833 người.\r\n\r\n<h5><b>Thời kỳ từ năm 1975 đến nay</b></h5>\r\nNgày 3-4-1975, Đà Lạt được giải phóng. Một trang sử mới của thành phố trên cao nguyên Lang Biang đã được mở ra.\r\n<br>\r\nNhững ngày đầu giải phóng, dân số Đà Lạt bị tụt xuống một ít vì những người phục vụ trong quân đội, trong bộ máy chính quyền của chế độ cũ và một số người trở về quê quán; một bộ phận dân cư người Đà Lạt đi xây dựng vùng kinh tế mới ở các địa phương khác trong tỉnh Lâm Đồng. Tuy nhiên, chẳng bao lâu sau, dân số Đà Lạt đã được bổ sung nhờ chính sách tăng cường cán bộ từ miền Bắc, miền Trung vào cùng với việc tập trung ổn định cư dân vùng nông thôn, mở rộng địa giới Đà Lạt ra khu vực Thái Phiên (1975), Xuân Trường, Xuân Thọ (1979), và đặc biệt là sáp nhập thêm xã dân tộc ít người Tà Nung vào thành phố Đà Lạt.\r\n<br>\r\nTừ năm 1975 đến nay, địa giới hành chính thành phố Đà Lạt được mở rộng, nhiều cơ quan, đơn vị được thành lập, kinh tế - xã hội phát triển nên có sự gia tăng dân số cơ học đáng kể. Năm 1981, dân số Đà Lạt tăng lên 98.437 người. Đến năm 1982, Đà Lạt vượt lên ngưỡng 100.000 dân. Năm 1990 : 120.261 người. Theo thống kê ngày 1-4-1999, dân số Đà Lạt là 160.663 người, đến năm 2007 là 197.013 người.\r\n<br>\r\nBiến động dân số thành phố Đà LạtTrước Thế chiến thứ hai, dân số Đà Lạt rất ít, ngoài dân cư bản địa chỉ có một số ít người châu Âu làm công tác. Số người Kinh định cư đầu tiên ở Đà Lạt là những tù nhân, thay vì phải lưu đày ở Côn Đảo thì bị đưa lên Đà Lạt để khai phá đất hoang, xây dựng nhà cửa. Trong khoảng thời gian từ năm 1933 đến 1938 nhiều công trình giao thông được hoàn thành. Bắt đầu từ thời gian này dân số Đà Lạt bắt đầu tăng nhanh từ 1.500 người (1923) lên đến 9.000 người năm 1928 rồi 11.500 người vào năm 1936. Và đến cuối năm 1942, Đà Lạt đã đạt con số hai vạn dân.\r\n<br>\r\nKhi Thế chiến thứ hai bùng nổ, các viên chức Pháp không có khả năng trở về quê hương nên đổ xô lên Đà Lạt nghỉ mát. Dân số tăng nhanh trong thời kỳ này: 13.000 người năm 1940, 20.000 người (1942) và lên đến 25.000 người năm 1944. Trong thời gian kháng chiến 9 năm (1945-1954) dân số Đà Lạt chựng lại ở vào khoảng 25.000 người. Vào cuối năm 1954 dân số tăng lên đến 52.000 người và giữa năm 1955 là 53.390 người do người dân miền Bắc di cư vào Nam. Từ đấy dân số Đà Lạt tăng 73.290 người vào năm 1965, 89.656 người (1970) và đến năm 1982 dân số Đà Lạt đã vượt qua con số 100.000 người. Tính đến 31 tháng 12 năm 2012 dân số Đà Lạt là 214.443 người trên 64.132 hộ.', '4.png', ''),
(3, 'Giai  1945 - 1954', 'Các biến cố chính trị liên tục xảy ra trong vòng hai năm 1945 và 1946 đã làm cho cục diện cuộc chiến tranh Đông Dương có sự thay đổi một cách cơ bản.\r\n<br>\r\nKhi phát xít Nhật đảo chính thực dân Pháp (đêm 9-3-1945), tại Đà Lạt, Nhật đưa quân chiếm đóng nhiều nơi, đồng thời đào nhiều hầm hào công sự ở những vị trí quan trọng, dự trữ lương thực, thực phẩm và ráo riết bắt lính, bắt xâu. Giai đoạn này có đến 600 viên chức và kiều dân Pháp bị bắt tập trung ở hai cư xá Decoux và Bellevue khiến cho cư dân Đà Lạt càng thêm hoang mang.\r\n<br>\r\nSau khi Nhật đảo chính Pháp, nội các Trần Trọng Kim ra đời ngày 17-4-1945, Đà Lạt được giao cho người Việt Nam quản lý. Cách mạng tháng Tám thắng lợi, vua Bảo Đại thoái vị tại Huế ngày 30-8-1945. Trước đó, ngày 25-8-1945, tại Đà Lạt, Uỷ ban Nhân dân cách mạng lâm thời tỉnh Lâm Viên đã được thành lập. Tuy nhiên, chẳng bao lâu sau đó, Pháp chiếm lại Sài Gòn và Đà Lạt một lần nữa rơi vào tay người Pháp.\r\n<br>\r\nThực hiện chủ trương của Uỷ ban kháng chiến tỉnh Lâm Viên, một bộ phận dân chúng Đà Lạt đã lánh về Cầu Đất, Đơn Dương, Ninh Thuận, Bình Thuận hoặc trở về quê cũ làm ăn. Do đó đến năm 1946, dân số của Đà Lạt chỉ còn lại rất ít: chỉ khoảng 5.200 người. Người Pháp phải gọi Đà Lạt là “thành phố quạnh hiu”.\r\n<br>\r\nKhi trở lại chiếm đóng Đà Lạt, thực dân Pháp tìm mọi cách để đưa các hoạt động kinh tế – xã hội trở lại bình thường. Bộ máy chính quyền ở Đà Lạt đã được tổ chức lại, Tòa Đốc lý được đổi thành Tòa Thị chính cùng với việc thành lập hội đồng kỳ mục ở các phường. Chính quyền ở Đà Lạt một mặt ráo riết đàn áp những người bị tình nghi hoạt động cách mạng hoặc có hành động phá rối, mặt khác cũng ra sức kêu gọi dân chúng hồi cư.\r\n<br>\r\nTừ năm 1946 trở đi, tình hình chiến sự ở Đà Lạt và vùng ven đã không cho phép người Pháp và người Việt tự do đi lại như trước kia.\r\n<br>\r\nTừ năm 1947 đến đầu năm 1949, khi giao thông đã trở lại bình thường thì dân số Đà Lạt mới trở lại ổn định, người từ nhiều nơi dần quay về Đà Lạt. Tuy nhiên, sự kiện này không kéo dài bởi một thỏa hiệp được ký ở Paris giữa Bảo Đại với Pháp về vấn đề Đà Lạt và Tây Nguyên. Theo thỏa hiệp này, Pháp nhìn nhận Việt Nam là một quốc gia “độc lập và thống nhất”; nhưng trên thực tế, bởi một sự mặc cả giữa Bảo Đại và Bollaert, Pháp khuyên triều đình Huế nên tách Tây Nguyên thành một đơn vị hành chính riêng. Theo đó, ngày 14-4-1950, Bảo Đại ra Dụ số 6 – QT/TD lập nên “Hoàng triều Cương thổ” và chọn Đà Lạt làm trung tâm. Sau đó, ngày 10-11-1950, Bảo Đại tiếp tục ra Dụ số 4 – QT/TD với nội dung sửa đổi địa giới hành chính thị xã Đà Lạt và sáp nhập một phần tỉnh Lâm Viên vào tỉnh Đồng Nai Thượng. Bởi sự thay đổi đó, kể từ đây, người Kinh không còn tự do lên định cư ở Đà Lạt như trước. Mặc dầu vậy, chỉ vài năm sau đó, khoảng cuối năm 1953 đến đầu năm 1954, cuộc kháng chiến chống Pháp bước vào giai đoạn khốc liệt nhất nên dân chúng ở các tỉnh lân cận đã đổ về Đà Lạt để tị nạn chiến tranh.\r\n<br>\r\nĐây có thể xem là giai đoạn có rất nhiều biến động về dân cư của thành phố Đà Lạt. Dân số Đà Lạt vào tháng 3 - 1948 là 18.513 người. Cuối năm 1952, Đà Lạt có 25.041 người, trong đó 1.217 người Âu (không kể quân nhân), 752 người Hoa, 22.232 người Kinh, 840 nguời dân tộc bản địa.', '9.png', ''),
(4, 'Giai đoạn 1940 – 1945', 'Chiến tranh thế giới lần thứ hai bùng nổ vào ngày 1-9-1939 đã làm cho các viên chức và binh lính người Pháp ở Đông Dương khó  có điều kiện trở về quê hương. Tại Việt Nam, người Pháp vốn không quen với khí hậu nóng bức nên trong những dịp nghỉ, họ lên thành phố Đà Lạt quanh năm mát mẻ. Toàn quyền Decoux cũng chọn Đà Lạt làm nơi làm việc vào mùa hè từ tháng 5 đến tháng 10 hàng năm. Trước áp lực gia tăng dân số và các điều kiện khác, đồ án chỉnh trang và mở rộng Đà Lạt dựa trên ý tưởng của kiến trúc sư Pineau được kiến trúc sư J. Lagisquet bắt tay thực hiện kể từ ngày 8-1-1942. Theo đồ án này, Đà Lạt tiếp tục được mở rộng về phía nam, tây và tây bắc. Trong đó, khu trung tâm vẫn nằm ở phía nam Hồ Lớn (hồ Xuân Hương ngày nay) với các khu giải trí, khu chợ, trường học,… Bên cạnh đó, các cơ sở về giáo dục, y tế, giao thông, điện … cũng được tiếp tục phát triển trong giai đoạn này. Đáng chú ý là công trình đường Prenn mới đã được thay thế cho đường Prenn cũ (đường Khe Sanh, Mimosa ngày nay); nhà máy thuỷ điện Ankroet được khởi công.\r\n<br>\r\nTrước 1945, ở nội thành Đà Lạt hình thành hai khu vực cư dân cơ bản là phía bắc suối Cam Ly và phía nam suối Cam Ly. Ở cả hai khu vực này đều có người Việt sinh sống. Ở phía bắc suối Cam Ly, người Việt sống tập trung trong làng Đa Lạc, Cây số 4 (Đa Thuận, Hai Bà Trưng, La Sơn Phu Tử) Cây số 6 (Đa Thành), … Ở khu vực phía nam suối Cam Ly, người Việt sống tập trung tại Tân Lạc, Trại Hầm, Suối Cát (Xuân An), Nam Thiên,… Đồng thời, nhóm cư dân người Việt là công chức sống xen kẽ ở gần các khu bệnh viện, nhà ga, Sở Địa dư, Trường Yersin, Viện Pasteur,… Nếu cư dân người Việt sống tập trung ở hai khu vực bắc và nam suối Cam Ly thì người Hoa vốn hành nghề bán buôn nên hầu như chỉ sống tập trung ở khu vực Cầu Quẹo (đường Phan Đình Phùng) và quanh khu chợ (nay là khu Hòa Bình). Trong khi đó, người Pháp chủ yếu sống trong các khu biệt thự nằm ở phía nam suối Cam Ly và trong cư xá Bellevue, Decoux. Trong giai đoạn này, dân số Đà Lạt bắt đầu tăng lên khá nhanh: 13.000 người năm 1940 lên 20.000 người năm 1942, 21.000 người năm 1943 và 25.500 người vào năm 1944.', '8.png', ''),
(5, '', 'Năm 1914, Thế chiến thứ nhất bùng nổ đã gây khó khăn đối với người Âu trong việc trở về quê hương vào những dịp nghỉ hằng năm.\r\n<br>\r\nNgày 6-1-1916, tỉnh Lang Bian được thành lập. Ngày 20-4-1916, Hội đồng Nhiếp chính của triều đình Huế thông báo Dụ thành lập thị tứ Đà Lạt. Với các quyết định hành chính trên, Đà Lạt không những có cơ hội mở mang cơ sở hạ tầng mà còn là điều kiện để tăng nhanh về dân số. Năm 1915, nhiều người Âu đã đến Đà Lạt. Đồng thời, người Việt cũng đến định cư ở đây.\r\n<br>\r\nTrong giai đoạn này, Đà Lạt đã có nhiều cơ sở hạ tầng rất quan trọng được đầu tư xây dựng thu hút nhiều người Kinh lên Đà Lạt thi công các công trình.\r\n<br>\r\nĐồ án quy hoạch Đà Lạt được kiến trúc sư người Pháp Ernest Hébrard bắt đầu thực hiện từ năm 1921 và đến tháng 8-1923 thì hoàn thành. Theo đó, kiến trúc sư Ernest Hébrard có dự định xây dựng Đà Lạt thành thủ phủ của Liên bang Đông Dương. Theo đồ án quy hoạch của E. Hébrard, Đà Lạt ngoài các công sở, khu quân sự,… còn có các khu dân cư như: khu dân cư người Việt ở phía tây bắc thành phố với “khu Việt Nam, khu Việt Nam nới rộng, khu Việt Nam dự kiến, khu Việt Nam dự kiến nới rộng…”. Thực hiện đề án này, nhiều cơ sở hạ tầng từ Đà Lạt nối liền với các địa phương khác được hình thành như nối liền đường bộ Đà Lạt – Sài Gòn vào năm 1932, khai thông đường bộ Đồng Nai Thượng – Đắc Lắc năm 1937, hoàn thành hệ thống nhà ga xe lửa và đường sắt Tháp Chàm – Đà Lạt năm 1938.\r\n<br>\r\nViệc mở mang đường sá, xây dựng các cơ sở hạ tầng ở Đà Lạt đã tạo điều kiện thuận lợi cho dân cư từ khắp nơi đổ về Đà Lạt để định cư, du lịch và nghỉ dưỡng. Dân số Đà Lạt đã tăng lên một cách đáng kể từ 1.500 người năm 1923 lên 5.500 người năm 1935,  9.000 người năm 1938 và 11.500 người năm 1939', '5.png', '');
INSERT INTO `gioithieu` (`id`, `tennd`, `noidung`, `hinh`, `ghichu`) VALUES
(4, '', 'Những người có công kiến thiết thành phố còn sáng tạo một câu cách ngôn khéo léo bằng tiếng La Tinh: Dat Aliis Laetitiam Aliis Temperiem, có nghĩa Cho người này nguồn vui, cho người khác sự mát mẻ. Tác giả André Morval đã viết câu cách ngôn chiết tự này ở đầu một bài báo nhan đề Dalat: Cité de la Jeunesse với nội dung: \"Những người khai sinh ra nơi nghỉ mát trên miền núi danh tiếng của chúng ta đã xác định một cách rất hợp lý những nét hấp dẫn và những đặc tính tốt bằng một câu cách ngôn ghép chữ đầu rất khéo léo để liền theo huy hiệu thành phố\". <br>\r\nNăm 1937, khi xây dựng chợ Đà Lạt mới thay cho ngôi chợ cũ bằng gỗ bị cháy, người ta đã đề dòng chữ Dat Aliis Laetitiam Aliis Temperiem trên tường đầu hồi của công trình, phía trên là huy hiệu thành phố hình tròn, tạc hình một đôi thanh niên nam nữ người dân tộc cùng với hình núi đồi nhấp nhô và hình hiệu một con cọp. <br>\r\nVới khí hậu ôn hòa, cảnh quan thiên nhiên tươi đẹp và những di sản kiến trúc Pháp phong phú, Đà Lạt còn được gọi bằng nhiều cái tên khác như \"Thành phố mù sương\", \"Thành phố ngàn thông\", \"Thành phố ngàn hoa\", \"Xứ hoa Anh Đào\" hay \"Tiểu Paris\". ', '4.png', NULL),
(5, 'Tên gọi', 'Địa danh Đà Lạt được bắt nguồn từ chữ Đạ Lạch, tên gọi của con suối Cam Ly. Khởi nguồn từ huyện Lạc Dương, thác Cam Ly chảy qua khu vực Đà Lạt theo hướng Bắc – Nam, trong đó đoạn từ khoảng Hồ Than Thở tới thác Cam Ly ngày nay được gọi là Đạ Lạch. Theo ngôn ngữ của người Thượng, Da hay Dak có nghĩa là nước, tên gọi Đà Lạt có nghĩa nước của người Lạt, hay suối của người Lạt (người Cơ Ho).  <br>\r\nTrong một bài phỏng vấn đăng trên tạp chí Revue Indochine tháng 4 năm 1944, công sứ Cunhac, một trong những người tham gia xây dựng thành phố từ ngày đầu, đã nói: \"Cho mãi tới những năm sau này, khung cảnh ban sơ vẫn không có gì thay đổi. Ở tại chỗ của cái hồ nước trước đó, con suối nhỏ của bộ lạc người Lát đã chảy qua và người ta đã gọi suối này là Đà Lạt\". <br>\r\nVào thời kỳ đầu, các bản đồ cũng như sách báo thường chỉ nhắc đến địa danh Dankia hay Lang Biang. Nhưng sau khi Đà Lạt được chọn làm nơi nghỉ dưỡng thay vì Dankia, và đặc biệt từ khi nơi đây trở thành một thành phố, địa danh Đà Lạt mới xuất hiện thường xuyên\r\n', 'gioithieu3.png', 'Huy hiệu Đà Lạt thời Pháp thuộc'),
(6, '', 'Từ xa xưa, vùng đất này vốn là địa bàn cư trú của những cư dân người Lạch, người Chil và người Srê thuộc dân tộc Cơ Ho. Cuối thế kỷ 19, khi tìm kiếm một địa điểm để xây dựng trạm nghỉ dưỡng dành cho người Pháp ở Đông Dương, Toàn quyền Paul Doumer đã quyết định chọn cao nguyên Lâm Viên theo đề nghị của bác sĩ Alexandre Yersin, người từng thám hiểm tới nơi đây vào năm 1893. <br>\r\n\r\nTrong nửa đầu thế kỷ 20, từ một địa điểm hoang vu, người Pháp đã quy hoạch và xây dựng lên một thành phố xinh đẹp với những biệt thự, công sở, khách sạn và trường học, một trung tâm du lịch và giáo dục của Đông Dương khi đó. <br>\r\n \r\nTrải qua những khoảng thời gian thăng trầm của hai cuộc chiến tranh cùng giai đoạn khó khăn những thập niên 1970–1980, Đà Lạt ngày nay là một thành phố khá đông dân, đô thị loại I trực thuộc tỉnh, giữ vai trò trung tâm chính trị, kinh tế và văn hóa quan trọng của tỉnh Lâm Đồng và vùng Tây Nguyên, hướng đến là thành phố trực thuộc Trung ương vào năm 2030', 'gioithieu2.png', 'Bộ tộc Lạch và Chill'),
(7, 'Giới thiệu', 'Đà Lạt là một thành phố trực thuộc tỉnh và tỉnh lị tỉnh Lâm Đồng, nằm trên cao nguyên Lâm Viên, ở độ cao 1.500 m so với mặt nước biển và diện tích tự nhiên: 393,29 km². Với nhiều cảnh quan đẹp, Đà Lạt là một trong những thành phố du lịch nổi tiếng nhất của Việt Nam. <br>\r\nTrong thời Pháp thuộc, tên tiếng Latin Dat Aliis Laetitiam Aliis Temperiem có nghĩa là “cho những người này niềm vui, cho những người khác sự mát mẻ”. Đà Lạt được mệnh danh là : thành phố hoa, thành phố tình yêu, thành phố mùa xuân, thành phố sương mù.\r\n', 'gioithieu1.png', 'Trường Cao đẳng Sư phạm Đà Lạt - Một trong TOP10 ngôi trường cổ kính đẹp nhất Việt Nam');
