INSERT INTO `tintuc` (`id`, `ten`, `noidung`, `hinh`, `ngay`, `ghichu`, `idtt`) VALUES
(33, 'Đà Lạt: Những kết quả đạt được trong bảo vệ và phát triển môi trường rừng', 'Sau hơn 1 năm triển khai thực hiện Nghị quyết số 03 - NQ/ThU của Thành ủy Đà Lạt về tăng cường công tác quản lý, bảo vệ và phát triển rừng trên địa bàn thành phố đã đạt được nhiều kết quả của tích cực.<br>\r\nChiều 13/4, UBND TP.Đà Lạt đã tổ chức Hội nghị sơ kết 1 năm thực hiện Nghị quyết 03 của Thành ủy Đà Lạt trong công tác quản lý, bảo vệ và phát triển rừng.<br>\r\nQua hơn 1 năm triển khai thực hiện Nghị quyết, các cơ quan chuyên môn, Hạt Kiểm lâm, đơn vị chủ rừng, UBND các phường, xã đã nỗ lực, thực hiện tốt nhiệm vụ quản lý, bảo vệ và phát triển rừng, cơ bản đạt các chỉ tiêu, yêu cầu đề ra. Theo đó, công tác tuần tra, kiểm tra, xử lý vi phạm được tăng cường, phát hiện và xử lý kịp thời; công tác trồng rừng, trồng cây xanh đạt và vượt so với kế hoạch năm 2022; cơ bản hoàn thành việc tháo dỡ nhà kính, nhà lưới trên đất lâm nghiệp; hoàn thành công tác rà soát, điều chỉnh quy hoạch 3 loại rừng; trên địa bàn thành phố không để xảy ra điểm nóng về phá rừng, khai thác rừng.<br>\r\nCụ thể, thực hiện kế hoạch trồng 3,8 triệu cây xanh, giai đoạn 2021 – 2025, đến hiện tại, TP.Đà Lạt đã trồng hơn 790.000 cây xanh các loại (trong đó, năm 2021: trồng hơn 270.000 cây; năm 2022: trồng hơn 510.000 cây xanh); trồng rừng tập trung, trồng rừng sau giải tỏa đạt 41,37 ha, đạt 100% kế hoạch; độ che phủ rừng đạt hơn 51%; hoàn thành tháo dỡ 73,98 ha công trình nhà kính, nhà lưới trên đất quy hoạch lâm nghiệp, đạt tỉ lệ 100%; số vụ vi phạm đã được phát hiện, xử lý trong năm 2022 là 28 vụ, giảm so với năm 2021...<br>\r\n\r\nBên cạnh những kết quả đạt được, TP.Đà Lạt cũng đã thẳng thắn nhìn nhận những hạn chế, bất cập còn tồn tại như, công tác tuyên truyền, phổ biến pháp luật chưa được thực hiện thường xuyên, một bộ phận người dân chưa nhận thức sâu sắc trong việc bảo vệ rừng; tình trạng phá rừng, khai thác rừng, “gặm nhấm”, lấn chiếm đất lâm nghiệp trái pháp luật vẫn còn diễn ra; việc phối hợp tuần tra, kiểm tra phát hiện và ngăn chặn đôi khi chưa kịp thời…<br>\r\n\r\nĐể công tác quản lý, bảo vệ và phát triển rừng đạt được nhiều kết quả hơn trong thời gian tới, thành phố sẽ khắc phục những khó khăn, hạn chế còn tồn tại; trong đó, tiếp tục đẩy mạnh công tác tuyên truyền, giáo dục, nâng cao nhận thức và trách nhiệm về quản lý, bảo vệ và phát triển rừng trong đảng viên, cán bộ, công chức, viên chức, người lao động và các tầng lớp Nhân dân; tăng cường công tác tuần tra, kiểm tra, phát hiện, ngăn chặn kịp thời hành vi vi phạm về quản lý, bảo vệ rừng, quản lý khoáng sản; ứng dụng công nghệ thông tin trong công tác quản lý, bảo vệ rừng…<br>\r\n\r\nVới tinh thần quyết tâm thực hiện thắng lợi nhiệm vụ quản lý, bảo vệ, phát triển rừng giai đoạn 2023 - 2025, phấn đấu đạt và vượt các chỉ tiêu đã đề ra, tại hội nghị, các đại biểu cũng đã tham gia thảo luận, đóng góp ý kiến, đề xuất, đóng góp giải pháp để công tác quản lý, bảo vệ và phát triển rừng.<br>\r\n\r\nTại Hội nghị, UBND TP.Đà Lạt cũng đã tặng giấy khen cho 7 tập thể và 8 cá nhân có thành tích trong triển khai thực hiện Nghị quyết số 03 – NQ/ThU.<br>\r\n\r\n\r\n\r\n', 'dalat1.png', '2022-05-17', '', 2),
(34, 'Lãnh đạo Đà Lạt bất ngờ trước vụ phá rừng thông phòng hộ lớn nhất từ trước đến nay', 'Lãnh đạo TP.Đà Lạt (Lâm Đồng) bất ngờ trước vụ phá rừng thông phòng hộ lớn nhất từ trước đến nay tại tiểu khu (TK) 144B, trên địa bàn P.8.<br>\r\nSáng 18.5, ông Nguyễn Văn Sơn, Phó chủ tịch UBND TP.Đà Lạt, cho biết lãnh đạo TP đều bất ngờ trước vụ phá rừng thông phòng hộ lớn nhất từ trước đến nay tại TK 144B (không phải TK 148B như kiểm lâm Đà Lạt cung cấp cho báo chí ngày 17.5 - PV), trên địa bàn P.8, lâm phần do Ban quản lý rừng (BQLR) Lâm Viên quản lý.<br>\r\n<b>Vụ phá rừng thông quy mô lớn nhất tại Đà Lạt từ trước đến nay</b><br>\r\nÔng Sơn cho biết, ông đã đến hiện trường vụ phá rừng thông. Theo đó, từ đường Mai Anh Đào (P.8) vào đến vị trí rừng thông bị phá khoảng 5 km, giáp ranh với H.Lạc Dương; đường đi trắc trở, rừng thông bị cưa hạ nằm ở độ cao gần 1.600 m so với mực nước biển.<br>\r\nQuanh khu vực rừng thông bị cưa hạ không có đường đi, không có nguồn nước. Khu vực này hiểm trở, không được xem là trọng điểm phá rừng, vùng nguy cơ cao, nên khi có hàng trăm cây rừng bị cưa hạ, lãnh đạo TP.Đà Lạt đều bất ngờ.<br>\r\nÔng Sơn cho biết thêm, sáng 18.5, các cơ quan chuyên môn của TP và tỉnh Lâm Đồng vẫn tiếp tục khám nghiệm hiện trường, kiểm đếm cây rừng bị thiệt hại. Tuy nhiên, vẫn chưa xác định được mục đích của những người cưa hạ rừng thông.<br>\r\n\"Nếu lấy gỗ không có đường vận chuyển ra ngoài; nếu để chiếm đất thì không có nguồn nước để sản xuất\", ông Sơn đặt vấn đề.<br>\r\n\r\nTheo nhận định của cơ quan chuyên môn, rừng thông vừa bị cưa hạ nằm ngổn ngang được cưa làm 2 đợt; những người phá rừng dùng cưa điện không gây tiếng ồn và rất chuyên nghiệp, vì chỉ cưa 2 vết là thông đổ ngã.<br>\r\n\r\n“Đây là vụ phá rừng thông quy mô lớn nhất tại Đà Lạt từ trước đến nay, với số lượng thông bị thiệt hại trên 400 cây, trong đó có khoảng 100 cây bị ken gốc đổ hóa chất…” ông Sơn thông tin thêm.<br>\r\n<b>Khẩn trương điều tra, công khai vụ phá rừng</b><br>\r\nCũng trong sáng nay, UBND tỉnh Lâm Đồng cho biết vừa có văn bản chỉ đạo UBND TP.Đà Lạt và giao Công an Lâm Đồng khẩn trương điều tra, xử lý nghiêm vụ phá rừng trái pháp luật xảy tại lô a và lô b, khoảnh 15, tiểu khu 144B, Đà Lạt.<br>\r\nTỉnh Lâm Đồng yêu cầu Chủ tịch UBND TP.Đà Lạt chỉ đạo các cơ quan chức năng khẩn trương xác minh, điều tra, sớm hoàn tất hồ sơ để xử lý nghiêm; yêu cầu phải công khai vụ phá rừng trái pháp luật tại vị trí trên.<br>\r\nĐồng thời chỉ đạo đơn vị chủ rừng khẩn trương tổ chức giải tỏa, lập hồ sơ trồng ngay lại rừng, hoàn thành trước ngày 10.6; tổ chức kiểm điểm làm rõ trách nhiệm của các cơ quan, đơn vị, địa phương và cá nhân có liên quan để xử lý trách nhiệm theo quy định, hoàn thành trước ngày 31.5.<br>\r\n\r\nUBND tỉnh Lâm Đồng đề nghị Công an tỉnh phối hợp với Sở NN-PTNT, BQLR Lâm Viên phối hợp khẩn trương điều tra, xác minh, xử lý vụ việc; tổ chức trồng lại rừng, không để đối tượng vi phạm canh tác, sử dụng, sang nhượng diện tích rừng bị phá; tổ chức kiểm điểm làm rõ trách nhiệm của các cá nhân, tổ chức liên quan…<br>\r\nSau khi có chỉ đạo trên, Công an Lâm Đồng đã huy động các lực lượng đến hiện trường để phối hợp với ngành kiểm lâm, chủ rừng và TP.Đà Lạt tiếp tục khám nghiệm hiện trường vụ cưa hạ rừng thông phòng hộ trái phép nói trên.<br>Như Thanh Niên đã phản ánh, ngày 17.5, cơ quan chức năng của TP.Đà Lạt đã khám nghiệm hiện trường, kiểm đếm vụ hàng trăm cây thông 3 lá bị triệt hạ tại khoảnh 15, tiểu khu 144B, lâm phần do BQLR Lâm Viên quản lý. Theo ghi nhận của PV, tại hiện trường có khoảng 400 cây thông 3 lá bị cưa hạ nằm ngổn ngang, cành lá vẫn còn tươi rói; không có dấu hiệu bị cưa thành khúc để lấy gỗ.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'pharung3.png', '2022-05-18', '', 2),
(35, 'Đà Lạt: Những kết quả đạt được trong bảo vệ và phát triển môi trường rừng', 'Chỉ tiêu trồng 3,8 triệu cây xanh trên địa bàn đã đạt những kết quả khả quan: Trồng 15.780 cây mai anh đào phân định ranh sản xuất nông nghiệp với rừng, đất lâm nghiệp; 2 mô hình trồng 2.000 cây tùng xung quanh nhà kính tại Phường 11, Phường 12… <br>\r\n\r\nNhận thức được tầm quan trọng về bảo vệ môi trường trong phát triển bền vững của địa phương, những năm qua, cấp ủy, chính quyền thành phố Đà Lạt đã tập trung lãnh đạo, chỉ đạo quán triệt, cụ thể hóa và quyết liệt thực hiện các chủ trương, chính sách của Đảng, Nhà nước về bảo vệ môi trường rừng và đạt được những kết quả quan trọng.<br>\r\n\r\nGiao khoán bảo vệ gần 15.655 ha rừng<br>\r\n\r\nTheo UBND thành phố Đà Lạt, căn cứ vào tình hình thực tế và tùy theo từng thời điểm hàng năm, UBND thành phố đã ban hành các quyết định, văn bản chỉ đạo trong công tác quản lý rừng, bảo vệ rừng; xây dựng, củng cố kiện toàn các Ban Chỉ huy về bảo vệ và phòng, chống cháy rừng từ cấp thành phố xuống đến cấp phường, xã. Đặc biệt, UBND thành phố Đà Lạt chỉ đạo nâng cao vai trò trách nhiệm của các đơn vị chủ rừng, Hạt Kiểm lâm, UBND các phường, xã trong công tác phối hợp quản lý, bảo vệ rừng và đất lâm nghiệp. Theo đó, thường xuyên luân chuyển cán bộ làm công tác kiểm lâm địa bàn; hàng năm tổng kết công tác quản lý, bảo vệ rừng để đánh giá kết quả đạt được, những tồn tại, hạn chế, xác định phương hướng, nhiệm vụ chỉ đạo thực hiện trong năm tiếp theo. UBND thành phố Đà Lạt cũng đã chỉ đạo các đơn vị phối hợp với Mặt trận và các đoàn thể tăng cường tuyên truyền các quy định của pháp luật liên quan đến công tác quản lý, bảo vệ và phát triển rừng đến cán bộ, đảng viên, công chức, viên chức, đoàn viên, hội viên và Nhân dân. Qua đó, vận động Nhân dân cùng tham gia trong công tác quản lý, bảo vệ rừng, phòng cháy, chữa cháy rừng; tham gia trồng rừng, trồng cây phân tán; đồng thời, tham gia phát hiện, ngăn chặn, thông báo đến chính quyền các trường hợp xâm hại tài nguyên rừng, lấn chiếm đất rừng.<br>\r\n“Công tác tuyên truyền qua các kênh thông tin truyền thanh, truyền hình, các cơ quan thông tấn báo chí; qua các đợt tập huấn, họp thôn, tổ, tổ chức ký cam kết, tuyên truyền lưu động; phát động phong trào trồng rừng, trồng cây phân tán, trồng cây 19/5… Nội dung, hình thức tuyên truyền phù hợp với điều kiện cụ thể của từng địa bàn, từng đối tượng dân cư để người dân nắm bắt cùng tham gia thiết thực công tác quản lý, bảo vệ và phát triển rừng ở địa phương…”, UBND thành phố Đà Lạt nhận định.<br>\r\n\r\nQua công tác tuyên truyền, vận động từ năm 2018 đến nay, toàn thành phố Đà Lạt đã trồng 383.327 cây xanh các loại. Riêng chỉ tiêu trồng 3,8 triệu cây xanh trên địa bàn đã đạt những kết quả như: Trồng 15.780 cây mai anh đào phân định ranh sản xuất nông nghiệp với rừng, đất lâm nghiệp; 2 mô hình trồng 2.000 cây tùng xung quanh nhà kính tại Phường 11, Phường 12… Các đơn vị chủ rừng trên địa bàn thành phố Đà Lạt cũng đã trồng rừng tập trung (hơn 183 ha), chăm sóc rừng (hơn 883,3 ha). Đáng kể đến nay, các đơn vị chủ rừng đã giao khoán bảo vệ rừng cho 402 hộ và 2 tổ chức với tổng diện tích gần 15.655 ha. Hàng tháng, hàng quý, các đơn vị chủ rừng phối hợp cùng chính quyền địa phương kiểm tra, nghiệm thu, chi trả dịch vụ môi trường rừng. Đăc biệt, qua rà soát hiện nay, toàn thành phố Đà Lạt có 92 doanh nghiệp được thuê rừng và đất lâm nghiệp triển khai dự án đầu tư với tổng diện tích 4.507 ha…<br>\r\n\r\nGiảm 20% mức độ thiệt hại về rừng<br>\r\n\r\nVới lãnh đạo UBND thành phố Đà Lạt mỗi tháng 10 – 15 lần và lãnh đạo UBND phường, xã 2 – 4 lần/tuần trực tiếp đi kiểm tra, nắm tình hình để kịp thời chỉ đạo ngăn chặn, xử lý kịp thời các hành vi phá rừng, lấn chiếm rừng và đất lâm nghiệp. Cụ thể, toàn thành phố Đà Lạt đã xử lý 268 vụ vi phạm về quản lý, bảo vệ rừng, đạt tỷ lệ 95% trên tổng số vụ được phát hiện. Trong đó, xử lý hình sự 7 vụ, còn lại xử phạt hành chính với số tiền hơn 4 tỷ đồng. Bên cạnh đó, UBND các phường, xã, đơn vị chủ rừng đã phối hợp với các đơn vị chức năng xử lý 176 trường hợp lấn chiếm, tái lấn chiếm đất lâm nghiệp với tổng diện tích gần 18,7 ha…<br>\r\n\r\nMục tiêu đến năm 2025, toàn thành phố Đà Lạt tiếp tục giảm 20% về số vụ vi phạm và 20% mức độ thiệt hại về rừng. Nhóm giải pháp trọng tâm được thành phố Đà Lạt tiếp tục triển khai đầy đủ nội dung của các Đề án Tăng cường công tác quản lý, bảo vệ rừng, ngăn chặn tình trạng phá rừng, lấn chiếm đất lâm nghiệp; khôi phục và phát triển rừng tỉnh Lâm Đồng giai đoạn 2020 – 2025, định hướng đến năm 2030; kế hoạch trồng 3,8 triệu cây xanh giai đoạn 2021 – 2025; kế hoạch quản lý, bảo vệ và phát triển rừng giai đoạn 2021 – 2025, định hướng đến năm 2030 trên địa bàn…\r\n', 'pharung4.png', '2022-05-17', '', 2),
(36, 'Buộc dừng các đêm nhạc không phép tổ chức giữa rừng thông Đà Lạt', 'Các cơ quan chức năng của TP Đà Lạt, Lâm Đồng vừa yêu cầu đơn vị và cá nhân liên quan dừng chương trình biểu diễn âm nhạc và tổ chức lều trại lưu trú không phép trong rừng thông.<br> Ngày 25/10, UBND phường 4 (TP Đà Lạt) cho biết đã yêu cầu đơn vị tổ chức dừng toàn bộ chương trình âm nhạc tại tiểu khu 162, đường Hoa hồng thuộc hồ Tuyền Lâm, phường 4.<br>\r\nTrước đó, ngày 24/10, UBND phường 4 phối hợp với Thanh tra Sở Văn hóa - Thể thao và Du lịch Lâm Đồng, Phòng Văn hóa - Thông tin TP Đà Lạt cùng các đơn vị liên quan kiểm tra việc tổ chức chương trình âm nhạc và cắm trại lưu trú tại lô E, khoảnh 2, Tiểu khu 162.<br>Chương trình này do Cty TNHH MTV K’Ho Discovery và một số cá nhân thường trú tại TPHCM phối hợp tổ chức.<br>\r\nQuá trình kiểm tra, các cơ quan chức năng phát hiện, lập biên bản việc dựng trái phép một sân khấu trang trí đèn, sàn lót gỗ với diện tích khoảng 48 m2, 23 lều trại có lót sàn bằng gỗ với diện tích mỗi lều chừng 20 m2. Ngoài ra, tại khu vực này còn có quầy pha chế, bàn ăn uống, bếp và các sàn gỗ để kê bàn ghế…<br>Làm việc với cơ quan chức năng, Cty TNHH MTV K’Ho Discovery không cung cấp được các giấy tờ liên quan tới việc tổ chức buổi biểu diễn chương trình âm nhạc và các hoạt động cắm trại.<br>Đoàn kiểm tra đã yêu cầu đơn vị tổ chức buổi biểu diễn, chương trình âm nhạc ngưng toàn bộ hoạt động lưu trú và tổ chức buổi biểu diễn âm nhạc không phép nói trên, tháo dỡ sân khấu, các lều bạt cắm trại, dọn dẹp các thiết bị điện tử trước 15h ngày 24/10.<br>\r\n\r\nTrước đó, trên mạng xã hội xuất hiện một số quảng cáo về chương trình đêm nhạc Camping tổ chức giữa rừng diễn ra vào các đêm 24-25/10. Thế nhưng qua thẩm tra, cơ quan chức năng phát hiện hoạt động nghệ thuật này chưa được Sở Văn hóa - Thể thao và Du lịch tỉnh Lâm Đồng cấp phép.<br>\r\n\r\nCác cơ quan liên quan của TP Đà Lạt và tỉnh Lâm Đồng đã thành lập đoàn để tiến hành kiểm tra ở nơi được quảng cáo tổ chức các chương trình âm nhạc nói trên.<br>\r\n\r\nĐoàn đã lập biên bản, yêu cầu những tổ chức, cá nhân có liên quan di dời toàn bộ lều trại, sân khấu ra khỏi khu vực rừng thông tại khu du lịch quốc gia hồ Tuyền Lâm, đồng thời buộc dừng các buổi biểu diễn ca nhạc dự kiến diễn ra vào các đêm 24, 25/10.<br>Thời gian qua, một số địa điểm ở TP Đà Lạt xuất hiện những khu vực cắm trại du lịch tự phát, không đủ các điều kiện để đón khách lưu trú, nguy cơ gây mất an ninh trật tự và an toàn cho người dân cùng du khách.\r\n\r\n\r\n', 'pharung5.png', '2023-10-26', '', 2),
(38, 'Hàng trăm người xuyên đêm chữa cháy rừng ở Đà Lạt', 'Cơ quan chức năng bước đầu xác định vụ hỏa hoạn kéo dài gần 10 tiếng đồng hồ, lan rộng trên diện tích hơn 10ha rừng thông. Hàng trăm người xuyên đêm dập lửa, khoanh vùng đám cháy, không để lan sang những khu vực khác.<br>\r\nSáng 7/4, nguồn tin từ Chi cục Kiểm lâm Lâm Đồng cho biết, vụ hỏa hoạn xảy ra trên diện tích hơn 10ha thuộc lô a, khoảnh 11, tiểu khu 267B (phường 3, TP. Đà Lạt). Cánh rừng bị cháy là rừng thông nguyên sinh có tuổi đời khoảng 70 năm, thuộc đối tượng rừng phòng hộ.<br>\r\nPhó Chủ tịch UBND tỉnh Lâm Đồng Nguyễn Ngọc Phúc cùng Chánh Văn phòng UBND tỉnh và lãnh đạo Chi cục Kiểm lâm túc trực tại hiện trường để trực tiếp chỉ đạo công tác chữa cháy.<br>\r\nLực lượng tham gia chữa cháy lên đến hơn 150 người, bao gồm cán bộ, nhân viên của Chi cục Kiểm lâm, Hạt Kiểm lâm TP. Đà Lạt, Ban Quản lý rừng Lâm Viên, Cảnh sát Phòng cháy chữa cháy, UBND phường 3, các hộ nhận khoán…<br>\r\nCán bộ kỹ thuật của Chi cục Kiểm lâm sử dụng thiết bị bay flycam để theo dõi và tìm kiếm các điểm cháy phát sinh xung quanh khu vực. Lực lượng phòng cháy chữa cháy được chia thành nhiều mũi, tiếp cận hiện trường để dập lửa và khoanh vùng đám cháy.<br>\r\nVụ hỏa hoạn xảy ra ở khu vực có độ dốc cao, sâu trong rừng; bên cạnh đó, vào ban đêm, tầm nhìn hạn chế, nhưng các lực lượng chữa cháy đã không quản nguy hiểm tiếp cận hiện trường, dập lửa để khống chế đám cháy.<br>\r\nCó những vị trí xe chữa cháy không thể tiếp cận, lực lượng tham gia chữa cháy phải chở bằng xe máy và vác bộ từng can nước vào sâu bên trong, kết hợp dùng cây dập lửa.<br>\r\nNhư Tiền Phong đã đưa tin, đám cháy được phát hiện vào khoảng 3 giờ chiều ngày 7/4, sau đó lan rộng ra nhiều ngọn đồi thuộc tiểu khu 267B. Đến 23 giờ 30 cùng ngày, đám cháy cơ bản được dập tắt.<br>\r\nTuy nhiên lực lượng chức năng vẫn dựng lều, phân công người trực suốt đêm bên bìa rừng để kịp thời ứng cứu, không để đám cháy bùng phát trở lại.<br>\r\nChi cục Kiểm lâm Lâm Đồng bước đầu xác định thảm cỏ và thực bì dưới tán rừng bị cháy rụi; đồng thời chỉ đạo lực lượng chữa cháy tiếp tục theo dõi khu vực rừng này, thống kê số cây rừng bị thiệt hại, điều tra xác định nguyên nhân xảy ra hỏa hoạn.\r\n\r\n\r\n\r\n', 'chayrung1.png', '2023-04-08', '', 3),
(39, 'Tăng cường các biện pháp cấp bách phòng cháy, chữa cháy rừng', 'Thủ tướng Phạm Minh Chính vừa ký ban hành Công điện số 441/CĐ-TTg ngày 22/5 về việc tăng cường các biện pháp cấp bách phòng cháy, chữa cháy rừng.<br>\r\nHiện trường vụ cháy rừng vào ngày 7/4 tại đèo Prenn-Đà Lạt, Lâm Đồng.\r\nTheo đó, hiện nay, nắng nóng gay gắt đang diễn ra ở nhiều địa phương trên cả nước, nhiệt độ cao nhất phổ biến từ 370C đến 390C, có nơi trên 400C, đặc biệt là tại các tỉnh khu vực Bắc Bộ, Trung Bộ và Tây Nam Bộ.<br>\r\nNguy cơ cháy rừng rất cao tại nhiều địa phương, đã có một số vụ cháy rừng xảy ra tại một số địa phương như: Hòa Bình, Sơn La, Điện Biên, Lai Châu, Quảng Trị, Quảng Nam, Lâm Đồng… gây thiệt hại lớn về rừng, môi trường sinh thái và ảnh hưởng đến đời sống của nhân dân trên địa bàn.<br>\r\n\r\nCác bộ, ngành và địa phương đã tích cực, chủ động triển khai công tác phòng cháy, chữa cháy rừng, qua đó đã góp phần giảm thiểu thiệt hại do cháy rừng gây ra. Thủ tướng Chính phủ đánh giá cao sự vào cuộc chỉ đạo quyết liệt của các cấp ủy đảng, chính quyền địa phương.<br>\r\nTheo dự báo của Trung tâm Dự báo khí tượng thủy văn quốc gia, trong thời gian tới, do ảnh hưởng của hiện tượng El Nino nên nắng nóng gay gắt hơn, với số ngày nắng cao hơn trung bình nhiều năm và có nhiều diễn biến bất thường.<br>\r\nNắng nóng kèm theo thiếu hụt lượng mưa làm nguy cơ xảy ra cháy rừng ở nhiều nơi là rất cao, gây thiệt hại về rừng, môi trường, ảnh hưởng đến sức khỏe, tài sản, tính mạng và đời sống của người dân.<br>\r\nĐể chủ động phòng cháy, chữa cháy rừng, giảm thiểu thiệt hại do cháy rừng gây ra, Thủ tướng Chính phủ yêu cầu:<br>\r\nChủ tịch Ủy ban nhân dân các tỉnh, thành phố trực thuộc trung ương chịu trách nhiệm về công tác phòng cháy, chữa cháy rừng trên địa bàn, khẩn trương chỉ đạo triển khai một số nhiệm vụ trọng tâm, cấp bách sau: yêu cầu Ủy ban nhân dân các cấp và các cơ quan chức năng thực hiện nghiêm trách nhiệm quản lý về công tác phòng cháy, chữa cháy rừng, tăng cường công tác kiểm tra, giám sát về phòng cháy, chữa cháy rừng, coi đây là nhiệm vụ trọng tâm, tuyệt đối không được chủ quan, lơ là, mất cảnh giác.<br>\r\nKiểm tra, rà soát lực lượng, phương tiện, vật tư; xây dựng phương án phòng cháy, chữa cháy rừng đảm bảo đầy đủ, sát thực tiễn, đủ khả năng ứng phó với tình huống cháy rừng xảy ra; chủ động bố trí kinh phí dự phòng của địa phương và các nguồn vốn hợp pháp khác để đảm bảo thực hiện tốt công tác phòng cháy, chữa cháy rừng.<br>\r\nTổ chức trực ban, phân công lực lượng ứng trực 24/24 giờ trong suốt mùa khô và các ngày nắng nóng; bố trí các điểm chốt chặn, tuần tra canh gác ở những khu vực trọng điểm dễ xảy ra cháy rừng, kiểm soát chặt chẽ người ra vào những khu vực rừng có nguy cơ cháy rừng cao; kịp thời phát hiện điểm cháy, huy động lực lượng tham gia khống chế và dập tắt cháy rừng trong thời gian ngắn nhất, không để xảy ra cháy lớn; thực hiện nghiêm túc chế độ báo cáo, bảo đảm đầy đủ, chính xác, kịp thời phục vụ công tác chỉ đạo, điều hành và tổ chức phòng cháy, chữa cháy rừng kịp thời, hiệu quả.<br>\r\nCó phương án sẵn sàng, chủ động di dời dân ra khỏi khu vực nguy hiểm khi cần thiết, bảo đảm an toàn tính mạng và tài sản của nhân dân và nhà nước.<br>\r\nTổ chức thực hiện có hiệu quả Đề án Nâng cao năng lực cho lực lượng kiểm lâm trong công tác quản lý, bảo vệ rừng và phòng cháy, chữa cháy rừng giai đoạn 2021-2030 được Thủ tướng Chính phủ phê duyệt tại Quyết định số 177/QĐ-TTg ngày 10/2/2022, kịp thời báo cáo những khó khăn, vướng mắc, gửi Bộ Nông nghiệp và Phát triển nông thôn để tổng hợp, xem xét, giải quyết theo thẩm quyền và quy định của pháp luật; khẩn trương ban hành cấp dự báo cháy rừng và các bảng tra cấp dự báo cháy rừng trên địa bàn theo quy định của pháp luật.<br>\r\nTăng cường tuyên truyền, giáo dục nâng cao ý thức, trách nhiệm trong công tác phòng cháy, chữa cháy rừng; kiểm tra, đôn đốc và hướng dẫn kiểm soát việc sử dụng lửa trong rừng và gần rừng của người dân, nhất là hoạt động đốt nương làm rẫy; dừng ngay việc dùng lửa để xử lý thực bì và những hành vi dùng lửa khác có nguy cơ gây cháy rừng.<br>\r\n\r\n', 'chayrung2.png', '2023-05-23', '', 3),
(40, 'Khởi động Dự án trồng rừng “Triệu cây xanh - Triệu hơi thở” tại Đà Lạt', 'Hoa hậu Phan Thị Ngọc Diễm, Chủ tịch sáng lập WLIN La Vie En Rose, chia sẻ dự án trồng rừng với 60.000 cây xanh có mục tiêu tiếp tục nâng cao nhận thức của mọi người, đặc biệt là cộng đồng nữ giới về vai trò của rừng, vấn đề bảo vệ rừng, nguồn nước, các vấn đề về bảo vệ môi trường, ứng phó với biến đổi khí hậu và gắn kết cộng đồng.<br>\r\n\r\n\"Để làm được điều này, tôi nghĩ rằng cần có sự chung tay đồng lòng của xã hội, mà trước tiên là những người phụ nữ nhiệt tâm. Giai đoạn 1 năm 2022, là cộng đồng nữ lãnh đạo chúng tôi sẽ cam kết cùng JCI Đà Lạt trồng được 10.000 cây xanh để tiến đến 2023 – 2024 sẽ thêm 50.000 cây xanh nữa. Với 60.000 cây ‘hướng đến 17 mục tiêu phát triển bền vững của Liên Hợp Quốc (17 SDGs)’, hoa hậu Ngọc Diễm chia sẻ.<br>\r\n\r\nĐồng thời, Hoa hậu Du lịch Việt Nam 2008 cũng mong muốn kết nối, vận động những người có cùng mục tiêu, lý tưởng để hoàn thành dự án này bởi đây là hoạt động hướng đến lợi ích vì một Việt Nam xanh. Cô cũng mong rằng sẽ lan tỏa được tinh thần xanh này đến với các bạn nhỏ và các ba mẹ nhiều hơn trong việc giáo dục nhận thức cho các thế hệ con em mai sau luôn quan tâm đến các vấn đề môi trường, sống xanh.<br>\r\n\r\nCũng trong dịp này, Quỹ Gieo mầm tương lai của bà Trần Thụy Ngọc Trúc - Chủ tịch sáng lập WLIN Elite, cũng đã trao tặng cho trường Tiểu học Xuân Trường công trình thư viện trị giá 50 triệu đồng dành cho các em.<br>\r\n\r\nWLIN Élite và WLIN La Vie En Rose là hai doanh nghiệp thành viên trực thuộc WLIN. Đây là mạng lưới dành cho các nữ lãnh đạo doanh nghiệp và các tổ chức xã hội có mong muốn tìm kiếm cơ hội hợp tác, phát triển kinh doanh và mở rộng quan hệ trong nước cũng như quốc tế.<br>\r\n\r\nWLIN sẽ đồng hành với những người phụ nữ trong hành trình hoàn thiện bản thân, nâng cao kỹ năng lãnh đạo, khả năng kết nối cũng như các phương thức sử dụng các mối quan hệ một cách hiệu quả và tích cực nhằm giúp họ phát triển công việc kinh doanh cũng như chăm sóc gia đình.<br>', 'trongrung1.png', '2022-09-21', '', 1),
(41, 'Phát động trồng \'rừng trong thành phố, thành phố trong rừng\'', 'Ngày 23-4, UBND tỉnh Lâm Đồng phối hợp cùng Tập đoàn Novaland phát động trồng 50 triệu cây xanh, giai đoạn 2021-2025 nhằm tăng 2% độ phủ xanh toàn tỉnh Lâm Đồng, dự kiến đạt hơn 55%.<br>\r\nTính riêng khu vực đô thị, kế hoạch này sẽ tăng 70% mảng xanh đô thị. Ban tổ chức chương trình kỳ vọng sẽ phủ xanh các khu vực còn thiếu mảng xanh ở đô thị Đà Lạt, thực hiện mục tiêu \"rừng trong thành phố, thành phố trong rừng\" được đưa ra ở đồ án quy hoạch chung cho TP Đà Lạt. <br>\r\nVới mục tiêu 50 triệu cây xanh, tỉnh Lâm Đồng đóng góp 5% lượng cây xanh cho kế hoạch 1 tỉ cây do Chính phủ phát động.<br>\r\n<b>Thêm mai anh đào cho phố hoa</b><br>\r\nÔng Nguyễn Văn Sơn, Giám đốc Sở Nông nghiệp và Phát triển nông thôn tỉnh Lâm Đồng, cho biết quỹ đất để trồng 50 triệu cây xanh sau khi cơ cấu chiếm tỉ lệ: 30% đất rừng trống, đồi trọc; 70% là diện tích mặt đất trống đô thị có thể trồng cây cảnh quan.<br>\r\nTheo ông Sơn, kế hoạch 50 triệu cây xanh có thể hiểu là một chiến dịch bổ khuyết mảng xanh cho những khu vực có hoạt động sinh sống, kinh doanh, du lịch, nghỉ dưỡng…<br>\r\n\"Chúng tôi xác định kế hoạch trồng cây sẽ giúp đô thị Đà Lạt nói riêng và vùng Lâm Đồng sớm đến gần - đạt mục tiêu \'thành phố trong rừng, rừng trong thành phố\'\". Tổng số cây giống phục vụ trồng cây xanh, trồng rừng 5 năm (2021-2025): 50 triệu cây; trong đó: trồng cây xanh cảnh quan đô thị 9,77 triệu cây; trồng cây lâm nghiệp 6,95 triệu cây; cây che bóng 33,28 triệu cây.<br>\r\nTrong kế hoạch xanh hóa đô thị Đà Lạt, 280.000 cây mai anh đào sẽ được trồng ở nhiều vị trí thuộc TP Đà Lạt và vùng lân cận. Theo tính toán của ban tổ chức, sau 5 năm vùng cao nguyên Lâm Viên sẽ trở thành \"thủ phủ\" mai anh đào.<br>\r\nÔng Văn Ngọc Thịnh, Giám đốc Tổ chức Quốc tế về Bảo tồn Thiên nhiên tại Lâm Đồng (WWF), nhìn nhận: \"Nói Đà Lạt là thành phố cao nguyên nhưng thực sự đang rất thiếu mảng xanh đô thị. Do đó, kế hoạch xanh hóa đô thị Lâm Đồng đang triển khai tôi cho rằng đã định hướng sát với thực tế\".<br>\r\nNgay trong đợt phát động của tỉnh Lâm Đồng, Novaland đã tài trợ 11 tỉ đồng cho hoạt động trồng cây của địa phương và trở thành đơn vị đầu tiên tài trợ cho dự án kéo dài 5 năm này. <br>\r\nÔng Bùi Xuân Huy, Tổng giám đốc Novaland, cho biết: \"Với mục tiêu phát triển bền vững cùng cộng đồng, đồng thời nhằm hiện thực hóa lời phát động của Thủ tướng Chính phủ \'Vì một Việt Nam xanh\', ngày hôm nay Tập đoàn Novaland cùng các thành viên của NovaGroup rất hân hạnh được tham gia và đồng hành cùng tỉnh Lâm Đồng\". <br>\r\nTheo ông Huy, con em của những người tham gia công tác trồng cây sẽ được hỗ trợ học bổng.<br>\r\n<b>Tăng mảnh xanh bằng nhiều nguồn lực</b><br>\r\nÔng Trần Văn Hiệp, Chủ tịch UBND tỉnh Lâm Đồng, trao đổi với Tuổi Trẻ: \"Trong 5 năm tới các nguồn lực sẽ được vận dụng tối đa để có thể gia tăng mảng xanh. Bên cạnh, cơ quan chức năng sẽ mạnh tay ngăn chặn phá rừng\". <br>\r\nÔng Hiệp cho rằng, Novaland đã dành ngân sách lớn cho hoạt động trồng cây xanh của tỉnh. Trong 5 năm, hoạt động này cần hơn 50 tỉ đồng, tỉnh sẽ huy động nhiều nguồn lực cùng thực hiện.<br>\r\nTheo UBND tỉnh Lâm Đồng, kế hoạch 50 triệu cây xanh là kế hoạch khả thi ngay từ khi khởi động bởi sự ủng hộ của doanh nghiệp và các tổ chức kinh tế - xã hội. Kế hoạch tiếp theo được UBND tỉnh Lâm Đồng đưa ra nhằm mau chóng đạt mục tiêu \"xanh\": Huy động các nguồn lực từ các nhà tài trợ, sử dụng các dự án vốn ODA, kết hợp lồng ghép các chương trình đầu tư công của nhà nước, như: kế hoạch phát triển lâm nghiệp giai đoạn 2021-2025; chương trình mục tiêu quốc gia xây dựng nông thôn mới giai đoạn 2021-2025; các dự án phát triển hạ tầng đô thị, xây dựng khu công nghiệp, công sở, làm đường giao thông có hạng mục trồng cây xanh trên địa bàn tỉnh,…<br>\r\nVới kế hoạch phối hợp cùng các đơn vị khác trong việc phát triển không gian xanh tại Lâm Đồng, ông Bùi Xuân Huy, Tổng giám đốc Novaland, nhìn nhận: \"Đi nhanh thì đi một mình, đi xa cần phải đi chung. Đối với một hoạt động xã hội lớn và tác động tốt, bền vững đến môi trường, Novaland không những thực hiện mà còn đồng hành nhiều đơn vị, tổ chức khác\".\r\n\r\n\r\n', 'trongrung2.png', '2023-04-23', '', 1);
INSERT INTO `tntn` (`id`, `tennd`, `noidung`, `hinh`, `ghichu`) VALUES
(1, 'e. Thủy điện:', 'Lâm Đồng là Tỉnh có nguồn thủy năng dồi dào, hoàn toàn đáp ứng được nhu cầu điện năng của cả Tỉnh. Tại Lâm Đồng hiện có nhà máy thủy điện Đa Nhim (công suất 160MW), thủy điện Suối Vàng (công suất 4,1MW), thủy điện Hàm Thuận – Đa Mi (công suất 475MW), thủy điện Đồng Nai 3 – Đồng Nai 4 (công suất 510MW) đang chuẩn bị khởi công vào cuối năm 2004 và thủy điện Đại Ninh đang được thi công (công suất 300MW).\r\nHiện nay toàn Tỉnh có 63 điểm có khả năng phát triển thủy điện do Viện Khoa Học Thủy Lợi khảo sát quy hoạch trong giai đoạn 1 trong đó có có 15 công trình thủy điện đã có chủ trương đầu tư và đang xin chủ trương đầu tư.', 'tn5.png', ''),
(2, 'd. Tiểu thủ công nghiệp:', 'Cùng với sự phát triển của ngành công nghiệp chế biến, sản phẩm tiểu thủ công nghiệp của Lâm Đồng, nhất là các sản phẩm phục vụ du lịch, cũng ngày càng phát triển mạnh mẽ và là một trong những thế mạnh của địa phương trên cơ sở thừa hưởng nét truyền thống, nguồn nguyên liệu dồi dào cộng với thế mạnh về tay nghề của người lao động. Các sản phẩm bao gồm: mây tre đan, thêu lụa, dệt thổ cẩm, hoa khô, đan len, chạm khắc, cưa lộng, gỗ mỹ nghệ, hàng lưu niệm… Hiện nay, Tỉnh đã có chủ trương khôi phục và phát triển sản xuất các sản phẩm tiểu thủ công nghiệp, xây dựng làng nghề truyền thống gắn với phát triển du lịch.', 'tn4.png', ''),
(3, 'c. Khoáng sản:', 'Lâm Đồng là vùng đất có nhiều loại khoáng sản với trữ lượng lớn chưa được khai thác. Theo thống kê toàn tỉnh có 25 loại khoáng sản, trong đó Bauxite, Bentonite, Kaolin, Diatomite và tham bùn có khả năng khai thác ở quy mô công nghiệp. Nổi bật nhất là quặng Bauxite với trữ lượng hơn 1tỷ tấn, chất lượng quặng khá tốt. 38 điểm quặng vàng (chủ yếu là vàng sa khoáng), 7 điểm quặng saphia, 32 điểm mỏ thiếc sa khoáng với trữ lượng hàng chục ngàn tấn, 19 mỏ sét gạch ngói,… và các loại khoáng sản khác như caolanh (12 mỏ), Diatomite, Bentonite, đá granite, than bùn. Ngoài ra Lâm Đồng còn có một số mỏ nước khoáng tại các huyện Lạc Dương, Đức Trọng, Cát Tiên và Đạ Huoai.', 'tn3.png', ''),
(4, 'b. Lâm sản:', 'Lâm Đồng có 617.815ha rừng với độ che phủ 63% diện tích toàn Tỉnh, trong đó có 355.357ha rừng gỗ, 80.446 rừng tre nứa, 27.326 rừng trồng… Do mưa nhiều, khí hậu ẩm ướt và đất đai phù hợp nên các loài tre, nứa, lồ ô có tốc độ tái sinh rất nhanh sau khi khai thác. Rừng Lâm Đồng mang nhiều nét điển hình của thảm thực vật Việt Nam, rất đa dạng, có trên 400 loại gỗ khác nhau, trong đó có một số loại gỗ quý như pơmu xanh, cẩm lai, gõ thông 2 lá, 3 lá… và nhiều loại lâm sản khác.', 'tn2.png', ''),
(6, 'Khí hậu', 'Do nằm ở độ cao 1.500 mét và được các dãy núi cùng quần hệ thực vật rừng, đặc biệt là rừng thông bao quanh, nên đối lập với khí hậu nhiệt đới gió mùa của miền trung và khí hậu nhiệt đới xavan ở miền nam, thành phố Đà Lạt có một khí hậu miền núi ôn hòa dịu mát quanh năm. <br>\r\n\r\nNằm trong vùng khí hậu nhiệt đới xavan, Đà Lạt có hai mùa rõ rệt: mùa mưa và mùa khô. Mùa mưa bắt đầu từ tháng 4 và kết thúc vào tháng 10. Còn mùa khô kéo dài từ tháng 11 năm trước đến tháng 3 năm sau. Vào mùa khô, Đà Lạt chịu ảnh hưởng của khối không khí biển Đông, mang lại thời tiết nắng ấm, ít mây, không mưa, nhiệt độ hạ thấp về ban đêm và biên độ nhiệt lớn. Trong những tháng mùa mưa, gió mùa đông bắc hầu như không còn ảnh hưởng đến Đà Lạt, thay thế bởi khối không khí xích đạo từ phía nam tràn lên phía bắc. Gió mùa tây nam mang lại nguồn ẩm chủ yếu cho những trận mưa lớn và những đợt mưa kéo dài nhiều ngày. Mặc dù vậy, do ảnh hưởng của khối không khí nhiệt đới Thái Bình Dương, trong mùa mưa vẫn có những thời kỳ thời tiết tạnh ráo.<br>\r\nNhiệt độ trung bình tháng ở Đà Lạt luôn dưới 20°C, ngay cả trong những tháng nóng nhất. Tuy vậy, Đà Lạt cũng không phải là nơi có nhiệt độ trung bình tháng thấp nếu so với các tỉnh thành phố miền bắc có khí hậu cận nhiệt đới. Trong những tháng mùa đông, nhiệt độ trung bình tháng vẫn trên 15 °C. Theo số liệu thống kê từ năm 1964 tới năm 1998, nhiệt độ trung bình năm ở Đà Lạt là 2.9 °C, trong đó năm 1973 có nhiệt độ trung bình cao nhất lên đến 18,5 °C, còn năm 1967 nhiệt độ trung bình xuống thấp nhất, 17,4 °C.[46] Nếu so sánh với Sa Pa, thị xã nghỉ dưỡng ở miền Bắc ở độ cao 1.581 mét so với mặt biển và nằm trong vùng cận nhiệt đới, thì nhiệt độ trung bình năm ở Đà Lạt cao hơn 2,6 °C. Vào tháng 12 thời điểm cuối năm, Đà Lạt hạ nhiệt vào ban đêm từ 6 °C đến 8 °C thậm chí xuống 4 °C. Buổi sáng vào mùa đông, Đà Lạt có mưa phùn và trời ít khi có nắng. và nếu xét riêng các tháng mùa đông thì nhiệt độ trung bình của Đà Lạt cao hơn Sapa đến 7 °C (tuy nhiên về mùa hè Sapa thường ấm hơn khoảng 2 °C đến 3 °C so với Đà Lạt không đáng kể).<br>\r\n\r\nBiên độ nhiệt độ ngày đêm ở Đà Lạt rất lớn, trung bình năm đạt 11 °C, cao nhất trong những tháng mùa khô, lên tới 13 – 14 °C, và thấp nhất trong những tháng mùa mưa, chỉ khoảng 6 – 7 °C. Ngược lại, biên độ nhiệt trung bình giữa các tháng trong năm lại nhỏ, tháng ấm nhất và tháng lạnh nhất cũng chỉ chênh lệch 3,5 °C.[48] Độ dài ngày trong các mùa ở Đà Lạt không có sự chênh lệch lớn, trung bình khoảng từ 11 đến ít hơn 12 giờ vào mùa đông và trên 12 giờ vào mùa hè. Tổng số giờ nắng trong năm ở đây tương đối cao, khoảng 2.236 giờ một năm, tập trung chủ yếu vào các tháng 12, 1, 2 và 3 của mùa khô. Tổng lượng bức xạ thu nhập ở Đà Lạt khoảng 140 kCalo/cm²/năm, nhiều nhất vào tháng 4 và ít nhất vào tháng 8. Nếu so với các vùng lân cận, lượng bức xạ Mặt Trời của Đà Lạt không cao, nhưng đây là nguồn năng lượng chủ yếu cho các quá trình trao đổi nhiệt, mang lại nền nhiệt độ thấp và tương đối ôn hòa.<br>\r\n\r\nMùa mưa ở Đà Lạt thường bắt đầu vào cuối tháng 4, đầu tháng 5 và kết thúc vào khoảng cuối tháng 10, đầu tháng 11. Tuy hàng năm, thời điểm bắt đầu và kết thúc của mùa mưa có thể thay đổi, nhưng mùa mưa ở đây thường kéo dài khoảng hơn 6 tháng. Trung bình, một năm Đà Lạt có 160 ngày mưa với lượng mưa 1.768 mm, tập trung nhiều nhất vào ba tháng 7, 9 và 10, ba tháng có sự hoạt động mạnh của trường gió mùa tây nam. Nếu lấy trung bình từ tháng 5 tới tháng 10, tổng lượng mưa trong mùa mưa ở Đà Lạt chiếm đến gần 80% lượng mưa của cả năm. So với vùng đồng bằng, Đà Lạt có số ngày mưa trong năm nhiều hơn, nhưng lượng mưa lại thấp hơn. \r\n<br> Ở Đà Lạt còn có một hiện tượng thời tiết đáng chú ý khác là sương mù, trung bình 80 đến 85 ngày trong một năm, nhưng xuất hiện nhiều nhất vào khoảng thời gian từ tháng 2 tới tháng 5 và từ tháng 9 đến tháng 10. Phổ biến hơn cả là loại sương mù bức xạ được hình thành khi mặt đất bị lạnh đi nhiều do bức xạ vào lúc trời quang, lặng gió. Sương mù dày ít xảy ra hơn, thường gặp vào tháng 9 và tháng 10, trung bình mỗi tháng có tới 4 đến 5 ngày sương mù dày. <br>\r\n<h5><b>a. Nguyên liệu nông sản:</b></h5>\r\nTài nguyên đất đai của Lâm Đồng rất thích hợp để phát triển các loại cây công nghiệp dài ngày như chè, càphê, dâu tằm… và rau hoa. Lâm Đồng đã hình thành nhiều vùng chuyên canh tập trung và là thị trường tiềm năng về nguyên liệu cho công nghiệp chế biến nông sản thực phẩm. Lâm Đồng đứng đầu cả nước về sản xuất chè, rau hoa chất lượng cao; đứng thứ 2 cả nước về sản xuất càphê; chiếm tỷ trọng đáng kể về các sản phẩm như dâu tằm tơ, hạt điều, bò thịt sữa, mía đường, dược liệu… Một số nguồn nguyên liệu chính như sau: <br>\r\nCà phê: Là một trong những loại cây công nghiệp dài ngày có thế mạnh phát triển của địa phương. Diện tích càphê ổn định lâu dài đạt khoảng 120.000ha, đặc biệt là giống càphê Arabica tại Đà Lạt, Lâm Hà và Đức Trọng là loại có chất lượng cao.\r\n<br>\r\nChè: Với điều kiện thuận lợi về khí hậu và thổ nhưỡng, cây chè ở Lâm Đồng phát triển mạnh mẽ từ hơn 70 năm qua. Đến nay, Lâm Đồng có diện tích chè lớn nhất nước (chiếm 30%diện tích chè cả nước) và có năng suất cao hơn hẳn năng suất trung bình toàn quốc. Diện tích chè toàn Tỉnh đạt 25.447ha, có khả năng phát triển lên đến 28.000ha. Lâm Đồng cũng thích hợp để trồng các loại giống chè quý, chất lượng cao của Đài Loan, Trung Quốc, Nhật Bản…\r\n<br>\r\nDâu tằm: khí hậu của Lâm Đồng thích hợp cho việc nuôi tằm lưỡng hệ quanh năm. Diện tích ổn định lâu dài đạt khoảng 8 – 10 ngàn ha, sản lượng dâu khoảng 100 – 120 ngàn tấn, sản lượng kén tằm đạt khoảng 6,5 – 8 ngàn tấn, phân bố chủ yếu ở các huyệb Đạ Huoai, Đạ Tẻh, Cát Tiên, Bảo Lâm, Bảo Lộc, Đơn Dương, Lâm Hà, Đức Trọng.\r\n<br>\r\nĐiều: Diện tích điều toàn Tỉnh đạt 7.300ha và có khả năng phát triển lên 8.300ha. Hàng năm Lâm Đồng có thể thu hoạch khoảng 2.300tấn nhân.\r\n<br>\r\nNgành công nghiệp chế biến sữa cũng là một tiềm năng lớn của Tỉnh. Phấn đấu đến năm 2010, toàn Tỉnh có khoảng 6.000 con bò sữa với sản lượng sữa tươi khoảng 12.420 tấn.', 'tn1.png', ''),
(7, 'Địa hình', 'Địa hình Đà Lạt được phân thành hai dạng rõ rệt: địa hình núi và địa hình bình nguyên trên núi. Địa hình núi phân bố xung quanh vùng cao nguyên trung tâm thành phố. Các dãy núi cao khoảng 1.700 mét tạo thành một vành đai chắn gió che cho khu vực lòng chảo trung tâm. Từ thành phố nhìn về hướng bắc, núi Langbiang như một tường thành theo hướng đông bắc – tây nam, kéo dài từ suối Đạ Sar đến hồ Dankia. Hai đỉnh cao nhất của dãy núi này có độ cao 2.167 mét và 2.064 mét. Án ngữ phía đông và đông nam Đà Lạt là hai dãy Bi Doup và Cho Proline. Về phía nam, địa hình núi chuyển tiếp sang bậc địa hình thấp hơn, đặc trưng là khu vực đèo Prenn với các dãy núi cao xen kẽ những thung lũng sâu. <br>\r\nTrung tâm Đà Lạt như một lòng chảo hình bầu dục dọc theo hướng bắc – nam với chiều dài khoảng 18 km, chiều rộng khoảng 12 km. Những dãy đồi đỉnh tròn ở đây có độ cao tương đối đồng đều nhau, sườn thoải về hướng hồ Xuân Hương và dần cao về phía các vùng núi bao quanh.[39] Nơi cao nhất trong trung tâm thành phố là dinh Nguyễn Hữu Hào trong Bảo tàng Lâm Đồng với độ cao 1.532 mét, còn điểm thấp nhất là thung lũng Nguyễn Tri Phương, độ cao 1.398 mét. <br>\r\n\r\nTrên địa phận thành phố Đà Lạt, xen giữa vùng đồi thấp trung tâm thành phố và các dãy núi bao quanh, có thể thấy hơn 20 dòng suối có chiều dài trên 4 km, thuộc các hệ thống suối Cam Ly, Đa Tam và hệ thống sông Đa Nhim. Đây đều là những con suối đầu nguồn thuộc lưu vực sông Đồng Nai, trong đó hơn một nửa là các con suối cạn, chỉ chảy vào mùa mưa và cạn kiệt vào mùa khô. Suối Cam Ly dài 64,1 km, bắt nguồn từ huyện Lạc Dương, chảy theo hướng bắc – nam và đổ vào hồ Xuân Hương. Đây chính là hệ thống suối lớn nhất Đà Lạt, có vai trò quan trọng trong việc tạo cảnh quan cho khu vực đô thị trung tâm. <br>\r\nĐà Lạt còn nổi tiếng là thành phố của hồ và thác với khoảng 16 hồ lớn nhỏ phân bố rải rác, phần nhiều là các hồ nhân tạo. Hồ Xuân Hương nằm ở trung tâm thành phố, rộng khoảng 38 ha, được tạo lập năm 1919 trong quá trình xây dựng Đà Lạt.\r\nTrước năm 1986, hồ Xuân Hương cùng hồ Chiến Thắng và hồ Than Thở là nguồn cung cấp nước chủ yếu cho thành phố. Ngày nay, nguồn nước sinh hoạt được dẫn về từ hồ Dankia thuộc huyện Lạc Dương, cách Đà Lạt khoảng 17 km.', 'tn.png', '');
INSERT INTO `trangchu` (`id`, `tieude`, `noidung`, `hinh`, `ngay`, `ghichu`, `trangthai`) VALUES
(1, 'Vụ phá rừng thông quy mô lớn ở Đà Lạt: Khởi tố, bắt tạm giam 3 bị can', 'Ngày 11/8, liên quan tới vụ cưa hạ hàng trăm cây thông ba lá tại lô a và lô b, khoảnh 15 Tiểu khu 144B (thuộc địa bàn Phường 8, lâm phần do Ban Quản lý rừng Lâm Viên quản lý), Công an thành phố Đà Lạt (Lâm Đồng) cho biết đã tống đạt quyết định khởi tố, bắt tạm giam đối với 3 bị can để điều tra về hành vi hủy hoại rừng.<br>\r\n\r\nCác bị can gồm Lê Thị Minh (60 tuổi, quê quán Tuyên Quang), vợ chồng Bùi Thị Huyền (38 tuổi, quê Hoà Bình) và Dương Kim Hà (40 tuổi, quê Hà Tĩnh), đều tạm trú tại Phường 12, thành phố Đà Lạt.<br>\r\n\r\nTại Cơ quan công an, các đối tượng khai nhận phá rừng với mục đích chiếm đất rừng để sản xuất nông nghiệp. Riêng bị can Lê Thị Minh trước đó từng có hành vi hủy hoại rừng trên địa bàn huyện Lạc Dương và đã bị xử phạt vi phạm hành chính.<br>', 'rung1.png', '2022-08-11', '', 0),
(2, 'Điều tra vụ phá rừng thông Đà Lạt\r\n', 'UBND tỉnh Lâm Đồng, ngày 17/5, đã có văn bản chỉ đạo các cơ quan chức năng khẩn trương điều tra, xử lý nghiêm vụ phá rừng thông tại Tiểu khu 144B do Ban Quản lý rừng Lâm Viên quản lý, lâm phần thuộc địa bàn Phường 8, TP Đà Lạt…<br>\r\nTheo đó, UBND tỉnh yêu cầu Chủ tịch UBND TP Đà Lạt chỉ đạo các cơ quan chức năng khẩn trương xác minh, điều tra, sớm hoàn tất hồ sơ để xử lý nghiêm, công khai vụ phá rừng tại lô a, b, Khoảnh 15, Tiểu khu 144B, Phường 8, TP Đà Lạt. Đồng thời, tổ chức kiểm điểm, làm rõ trách nhiệm của các cơ quan, đơn vị, địa phương và cá nhân có liên quan để xử lý trách nhiệm theo quy định. Và đề nghị đơn vị chủ rừng khẩn trương tổ chức giải tỏa, lập hồ sơ trồng lại rừng trước ngày 10/6/2022. <br>\r\n\r\nUBND tỉnh đề nghị Công an tỉnh chỉ đạo các phòng nghiệp vụ tập trung điều tra, xử lý nghiêm vụ vi phạm theo quy định. Riêng Sở Nông nghiệp và Phát triển nông thôn, Ban Quản lý rừng Lâm Viên phối hợp với Công an tỉnh trong quá trình điều tra, xác minh, xử lý vụ việc. Khẩn trương tổ chức trồng lại rừng, không để đối tượng vi phạm canh tác, sử dụng, sang nhượng diện tích rừng bị phá; tổ chức kiểm điểm làm rõ trách nhiệm của các nhân, tổ chức liên quan. <br>\r\n\r\nTrước đó, ngày 14/5, cơ quan chức năng TP Đà Lạt phát hiện vụ phá rừng nghiêm trọng trên. Đây được xem là vụ phá rừng thông ba lá lớn nhất tại TP Đà Lạt xảy ra từ trước đến nay. Các đối tượng thực hiện hành vi phá rừng rất liều lĩnh và coi thường pháp luật. <br>', 'pharung2.png', '2022-11-30', '', 0),
(4, 'Chương trình đổi bao bì thuốc bảo vệ thực vật lấy quà tặng ở xã Trạm Hành', 'Nằm trong chuỗi hoạt động chào mừng 130 năm Đà Lạt hình thành và phát triển; Chào mừng Đại hội Hội Nông dân các cấp nhiệm kỳ 2023 - 2028, chào mừng Đại hội đại biểu Hội Nông dân tỉnh Lâm Đồng lần thứ IX...', '2.png', '2023-12-01', '', 1),
(5, 'CÔNG TÁC XÂY DỰNG ĐẢNG Ở TRƯỜNG ĐẠI HỌC ĐÀ LẠT: Điểm nhấn rõ nét sau nửa nhiệm kỳ', 'Đồng chí Lê Minh Chiến - Bí thư Đảng ủy, Hiệu trưởng Trường Đại học Đà Lạt, cho biết: Đảng bộ Trường Đại học Đà Lạt hiện có 206 đảng viên (trong đó có 21 đảng viên là sinh viên) sinh hoạt trong 22 chi bộ trực thuộc (5 chi bộ phòng, ban, 15 chi bộ khoa chuyên môn và 2 chi bộ sinh viên) và 2 ban (Ủy ban Kiểm tra và Ban Tuyên giáo). ', '4.png', '2023-12-01', '', 1),
(6, 'Đường sắt tăng tàu du lịch Đà Lạt, khách được xem hòa tấu âm nhạc miễn phí', 'Đường sắt chạy thêm tàu du lịch Đà Lạt, phục vụ biểu diễn miễn phí hòa tấu âm nhạc, chụp ảnh check-in trong tháng 12. Công ty CP Vận tải đường sắt Sài Gòn cho biết, đây là một trong các hoạt động được ngành đường sắt tổ chức nhằm chào mừng kỷ niệm 130 năm TP Đà Lạt hình thành và phát triển (1893-2023).\r\n', '5.png', '2023-12-02', '', 1);
